}

contracts/profiles/enrolment-conditions/.content:
pragma solidity ^0.5.0;

import "@ensdomains/resolver/contracts/ResolverBase.sol";

/**
 * Profile for resolving type of conditions required for an identity to be eligible for a role.
 * A role can require a combination of the types.
 * These possible types are:
 * 00: The requesting identity must have some role
 */
contract EnrolmentConditionTypeResolver is ResolverBase {
    bytes4 private constant ENROLMENT_CONDITION_TYPE_INTERFACE_ID = 0xafe767c6;

    event EnrolmentConditionTypeAdded(bytes32 indexed node, uint256 addedType);
    event EnrolmentConditionTypeRemoved(
        bytes32 indexed node,
        uint256 removedType
    );

    mapping(bytes32 => mapping(uint256 => bool)) public conditionTypes;

    /**
     * Adds a conditionType required for a role.
     * If type is already required for a role, no action is taken.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param conditionType The conditionType to add.
     */
    function addConditionType(bytes32 node, uint256 conditionType)
        external
        authorised(node)
    {
        if (conditionTypes[node][conditionType] == false) {
            conditionTypes[node][conditionType] = true;
            emit EnrolmentConditionTypeAdded(node, conditionType);
        }
    }

    /**
     * Removes a conditionType required for a role.
     * If type is already not required for a role, no action is taken.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param conditionType The conditionType to add.
     */
    function removeConditionType(bytes32 node, uint256 conditionType)
        external
        authorised(node)
    {
        if (conditionTypes[node][conditionType] == true) {
            conditionTypes[node][conditionType] = false;
            emit EnrolmentConditionTypeRemoved(node, conditionType);
        }
    }

    /**
     * Returns whether or not a condition type is required for a role
     * @param node The ENS node to query.
     * @param condition The condition to check
     * @return Whether or not the role requires this condition
     */
    function requiresConditionType(bytes32 node, uint256 condition)
        external
        view
        returns (bool)
    {
        return (conditionTypes[node][condition]);
    }

    function supportsInterface(bytes4 interfaceID) public pure returns (bool) {
        return
            interfaceID == ENROLMENT_CONDITION_TYPE_INTERFACE_ID ||
            super.supportsInterface(interfaceID);
    }
}

pragma solidity ^0.5.0;

import "@ensdomains/resolver/contracts/ResolverBase.sol";

/**
 * Profile for resolving roles which an identity must have to be eligible for a role claim
 */
contract EnrolmentPrerequisiteRolesResolver is ResolverBase {
    bytes4 private constant PREREQUISITE_ROLES_INTERFACE_ID = 0xc986c404;

    event PrerequisiteRolesChanged(
        bytes32 indexed node,
        bytes32[] newPrerequisiteRoles
    );

    mapping(bytes32 => bytes32[]) prerequisiteRolesMap;

    /**
     * Sets the prerequisite role required to be eligible for a role claim.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param roles The prerequisite roles to set.
     */
    function setPrerequisiteRoles(bytes32 node, bytes32[] calldata roles)
        external
        authorised(node)
    {
        prerequisiteRolesMap[node] = roles;
        emit PrerequisiteRolesChanged(node, prerequisiteRolesMap[node]);
    }

    /**
     * Returns the prerequisite roles required to be eligible for a role claim.
     * @param node The ENS node to query.
     * @return The prequisite roles.
     */
    function prerequisiteRoles(bytes32 node)
        external
        view
        returns (bytes32[] memory roles)
    {
        return (prerequisiteRolesMap[node]);
    }

    function supportsInterface(bytes4 interfaceID) public pure returns (bool) {
        return
            interfaceID == PREREQUISITE_ROLES_INTERFACE_ID ||
            super.supportsInterface(interfaceID);
    }
}

contracts/profiles/issuance/IssuersResol.content:
pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import "@ensdomains/resolver/contracts/ResolverBase.sol";

/**
 * Profile for resolving identities (by did or by role) which can issue a role definition
 */
contract IssuersResolver is ResolverBase {
    bytes4 private constant ISSUERS_INTERFACE_ID = 0xc53a4413;

    struct Issuers {
        address[] dids;
        bytes32 role;
    }

    event IssuersChanged(bytes32 indexed node, Issuers newIssuers);

    mapping(bytes32 => Issuers) issuersMap;

    /**
     * Sets the dids associated with a role.
     * Clears the role associated with a role.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param dids The dids to set.
     */
    function setIssuerDids(bytes32 node, address[] calldata dids)
        external
        authorised(node)
    {
        issuersMap[node].dids = dids;
        delete issuersMap[node].role;
        emit IssuersChanged(node, issuersMap[node]);
    }

    /**
     * Sets the dids associated with a role.
     * Clears the role associated with a role.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param role The role to set.
     */
    function setIssuerRole(bytes32 node, bytes32 role)
        external
        authorised(node)
    {
        issuersMap[node].role = role;
        delete issuersMap[node].dids;
        emit IssuersChanged(node, issuersMap[node]);
    }

    /**
     * Returns the issuers associated with an ENS node.
     * @param node The ENS node to query.
     * @return The associated issuers.
     */
    function issuers(bytes32 node)
        external
        view
        returns (address[] memory dids, bytes32 role)
    {
        return (issuersMap[node].dids, issuersMap[node].role);
    }

    function supportsInterface(bytes4 interfaceID) public pure returns (bool) {
        return
            interfaceID == ISSUERS_INTERFACE_ID ||
            super.supportsInterface(interfaceID);
    }
}

contracts/profiles/issuance/IssuerTypeRe.content:
pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import "@ensdomains/resolver/contracts/ResolverBase.sol";

/**
 * Profile for resolving type of issuance expect for a role.
 * The types are mutually exclusive. A role can only have a single type at a time.
 * These possible types are:
 * 00: Approval by some identity (i.e. an identity from a list of DIDs, or an identity with a given role)
 * 10: “Real-time” approval by a smart contract.
 */
contract IssuerTypeResolver is ResolverBase {
    bytes4 private constant ISSUER_TYPE_INTERFACE_ID = 0xc585f697;

    event IssuerTypeChanged(bytes32 indexed node, uint8 newType);

    // uint used instead of enum so that new types can be added with needing to update the resolver
    mapping(bytes32 => uint8) public issuerTypes;

    /**
     * Sets the issuerType associated with a role def.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param issuerType The issuerType to set.
     */
    function setIssuerType(bytes32 node, uint8 issuerType)
        external
        authorised(node)
    {
        issuerTypes[node] = issuerType;
        emit IssuerTypeChanged(node, issuerTypes[node]);
    }

    /**
     * Returns the issuerType associated with a role def.
     * @param node The ENS node to query.
     * @return The associated issuer type.
     */
    function issuerType(bytes32 node) external view returns (uint8) {
        return (issuerTypes[node]);
    }

    function supportsInterface(bytes4 interfaceID) public pure returns (bool) {
        return
            interfaceID == ISSUER_TYPE_INTERFACE_ID ||
            super.supportsInterface(interfaceID);
    }
}

